import React from 'react';
import profile from './ichigoProfile.png';


function Home() {
    return (<div className='profile_img text-center p-4'>
        <div className='flex flex-column justify-content-center align-items-center'>
            <img
                style={{
                    width: "200px",
                    height: "200px",
                    borderRadius: "50%",
                    objectFit: "cover",
                    border: "4px solid green",
                }} src={ profile} alt="" />
        </div>
        </div>);
}

export default Home;
